import React, { useState } from 'react';
import { AlertTriangle, Clock, TrendingUp, Filter, Download, Search, AlertCircle, Package, Eye } from 'lucide-react';

const ReviewSpamPage = () => {
  const [selectedAlert, setSelectedAlert] = useState(null);
  const [filterPriority, setFilterPriority] = useState('all');

  const spamReviews = [
    {
      id: 'RA001',
      title: 'High-value return abuse',
      description: 'Customer initiated 12 returns in 30 days',
      customerId: 'C987654321',
      amount: '$4,567.89',
      category: 'Serial Returner',
      timeframe: '30 days ago',
      riskScore: 94,
      priority: 'high',
      riskLevel: 'High',
      investigationBrief: 'Customer has exhibited suspicious return behavior with multiple high-value items returned within warranty periods. Pattern suggests potential return fraud scheme.',
      riskIndicators: ['high_return_frequency', 'high_value_items', 'short_ownership_period'],
      subAgentResults: {
        returnFrequencyAnalysis: { score: 95, confidence: 'High' },
        itemConditionAnalysis: { score: 88, confidence: 'Medium' },
        customerBehaviorAnalysis: { score: 92, confidence: 'High' }
      }
    },
    {
      id: 'RA002',
      title: 'Cross-category return pattern',
      description: 'Multiple returns across different product categories in short timeframe',
      customerId: 'C456789012',
      amount: '$1,234.56',
      category: 'Suspicious Pattern',
      timeframe: '14 days ago',
      riskScore: 76,
      priority: 'medium',
      riskLevel: 'Medium',
      investigationBrief: 'Customer returning items across multiple categories suggesting potential systematic abuse of return policy.',
      riskIndicators: ['cross_category_returns', 'timing_pattern', 'policy_exploitation'],
      subAgentResults: {
        returnFrequencyAnalysis: { score: 78, confidence: 'Medium' },
        itemConditionAnalysis: { score: 72, confidence: 'Medium' },
        customerBehaviorAnalysis: { score: 80, confidence: 'High' }
      }
    },
    {
      id: 'RA003',
      title: 'Refund timing manipulation',
      description: 'Customer returns items just before warranty expiration',
      customerId: 'C123456789',
      amount: '$899.99',
      category: 'Policy Abuse',
      timeframe: '7 days ago',
      riskScore: 45,
      priority: 'low',
      riskLevel: 'Low',
      investigationBrief: 'Customer consistently returns items near warranty expiration dates, indicating potential timing manipulation.',
      riskIndicators: ['warranty_timing', 'pattern_recognition'],
      subAgentResults: {
        returnFrequencyAnalysis: { score: 48, confidence: 'Low' },
        itemConditionAnalysis: { score: 42, confidence: 'Low' },
        customerBehaviorAnalysis: { score: 45, confidence: 'Medium' }
      }
    }
  ];

  const filteredAlerts = filterPriority === 'all' 
    ? spamReviews
    : spamReviews.filter(alert => alert.priority === filterPriority);

  const handleAction = (id, action) => {
    console.log(`Action taken on ${id}: ${action}`);
    // Add actual implementation here
  };

  const getPriorityColor = (priority) => {
    switch (priority) {
      case 'high': return 'bg-red-500 text-white';
      case 'medium': return 'bg-orange-500 text-white';
      case 'low': return 'bg-green-500 text-white';
      default: return 'bg-gray-500 text-white';
    }
  };

  const getRiskScoreColor = (score) => {
    if (score >= 80) return 'text-red-400';
    if (score >= 60) return 'text-orange-400';
    return 'text-green-400';
  };

  const InvestigationPanel = ({ selectedAlert, handleAction }) => {
    if (!selectedAlert) {
      return (
        <div className="bg-gray-800 rounded-xl shadow-xl border border-gray-700 p-8 text-center">
          <div className="text-gray-400 mb-4">
            <Eye className="h-12 w-12 mx-auto mb-4" />
            <h3 className="text-lg font-semibold text-white mb-2">No Alert Selected</h3>
            <p>Click on an alert card above to view detailed investigation information</p>
          </div>
        </div>
      );
    }

    const getRiskColor = (riskLevel) => {
      switch (riskLevel) {
        case 'High': return 'bg-red-600/90 text-white border-red-400';
        case 'Medium': return 'bg-yellow-500/90 text-black border-yellow-400';
        case 'Low': return 'bg-green-500/90 text-white border-green-400';
        default: return 'bg-gray-700 text-white border-gray-600';
      }
    };

    return (
      <div className="bg-gray-800 rounded-xl shadow-xl border border-gray-700">
        <div className="px-6 py-4 border-b border-gray-700 bg-gradient-to-r from-gray-800 to-gray-700 rounded-t-xl">
          <h2 className="text-lg font-semibold text-white flex items-center space-x-2">
            <Eye className="h-5 w-5 text-blue-400" />
            <span>Investigation Details</span>
          </h2>
        </div>

        <div className="p-6">
          <div className="mb-6">
            <div className="flex items-center justify-between mb-4">
              <h3 className="text-xl font-semibold text-white">{selectedAlert.title}</h3>
              <span className={`inline-flex items-center px-4 py-2 rounded-full text-sm font-semibold border-2 ${getRiskColor(selectedAlert.riskLevel)}`}>
                {selectedAlert.riskLevel} Risk
              </span>
            </div>
            <p className="text-gray-300 mb-6 leading-relaxed">{selectedAlert.description}</p>

            <div className="bg-gradient-to-r from-blue-900/30 to-indigo-900/30 rounded-lg p-5 mb-6 border border-blue-800/30">
              <h4 className="text-sm font-semibold mb-3 text-blue-300 flex items-center space-x-2">
                <AlertTriangle className="h-4 w-4" />
                <span>Investigation Brief</span>
              </h4>
              <p className="text-gray-100 leading-relaxed">{selectedAlert.investigationBrief}</p>
            </div>

            <div className="mb-6">
              <h4 className="text-sm font-semibold mb-3 text-white">Risk Indicators</h4>
              <div className="flex flex-wrap gap-2">
                {selectedAlert.riskIndicators.map((indicator, index) => (
                  <span key={index} className="inline-flex items-center px-3 py-1.5 rounded-full text-xs font-medium bg-red-600/80 text-white border border-red-500/50">
                    {indicator.replace(/_/g, ' ').toUpperCase()}
                  </span>
                ))}
              </div>
            </div>

            <div className="mb-8">
              <h4 className="text-sm font-semibold mb-4 text-white">Sub-Agent Analysis</h4>
              <div className="grid gap-3">
                {Object.entries(selectedAlert.subAgentResults).map(([agent, result]) => (
                  <div key={agent} className="flex items-center justify-between p-4 bg-gray-700 rounded-lg border border-gray-600">
                    <span className="text-sm font-medium text-white">{agent.replace(/([A-Z])/g, ' $1').trim()}</span>
                    <div className="text-right">
                      <div className="text-lg font-bold text-white">{result.score}%</div>
                      <div className={`text-xs font-medium ${
                        result.confidence === 'High' ? 'text-green-400' :
                        result.confidence === 'Medium' ? 'text-yellow-400' : 'text-red-400'
                      }`}>
                        {result.confidence} Confidence
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            </div>

            <div className="flex space-x-3">
              <button 
                onClick={() => handleAction(selectedAlert.id, 'confirmed_abuse')} 
                className="flex-1 bg-gradient-to-r from-red-600 to-red-700 text-white px-6 py-3 rounded-lg font-semibold hover:from-red-700 hover:to-red-800 transition-all duration-200 shadow-lg"
              >
                Confirm Abuse
              </button>
              <button 
                onClick={() => handleAction(selectedAlert.id, 'false_positive')} 
                className="flex-1 bg-gradient-to-r from-gray-600 to-gray-700 text-white px-6 py-3 rounded-lg font-semibold hover:from-gray-700 hover:to-gray-800 transition-all duration-200 shadow-lg"
              >
                False Positive
              </button>
              <button 
                onClick={() => handleAction(selectedAlert.id, 'escalate')} 
                className="flex-1 bg-gradient-to-r from-orange-600 to-orange-700 text-white px-6 py-3 rounded-lg font-semibold hover:from-orange-700 hover:to-orange-800 transition-all duration-200 shadow-lg"
              >
                Escalate
              </button>
            </div>
          </div>
        </div>
      </div>
    );
  };

  return (
    <div className="space-y-6 bg-gray-900 min-h-screen p-6">
      <div className="flex items-center justify-between">
        <div>
          <h2 className="text-2xl font-bold text-white flex items-center space-x-2">
            <Search className="h-6 w-6 text-green-400" />
            <span>Review Spam Detection</span>
          </h2>
          <p className="text-gray-400 mt-1">Identifying fake reviews and manipulation campaigns</p>
        </div>
        <div className="flex items-center space-x-4">
          <select 
            value={filterPriority}
            onChange={(e) => setFilterPriority(e.target.value)}
            className="bg-gray-700 text-white px-4 py-2 rounded-lg border border-gray-600"
          >
            <option value="all">All Priorities</option>
            <option value="high">High Priority</option>
            <option value="medium">Medium Priority</option>
            <option value="low">Low Priority</option>
          </select>
        </div>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
        <div className="bg-gradient-to-r from-red-900/30 to-red-800/30 rounded-lg p-4 border border-red-800/50">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-red-300 text-sm font-medium">High Risk Cases</p>
              <p className="text-2xl font-bold text-white">{spamReviews.filter(r => r.priority === 'high').length}</p>
            </div>
            <AlertCircle className="h-5 w-5 text-red-400" />
          </div>
        </div>
        <div className="bg-gradient-to-r from-yellow-900/30 to-yellow-800/30 rounded-lg p-4 border border-yellow-800/50">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-yellow-300 text-sm font-medium">Medium Risk Cases</p>
              <p className="text-2xl font-bold text-white">{spamReviews.filter(r => r.priority === 'medium').length}</p>
            </div>
            <Search className="h-5 w-5 text-yellow-400" />
          </div>
        </div>
        <div className="bg-gradient-to-r from-blue-900/30 to-blue-800/30 rounded-lg p-4 border border-blue-800/50">
          <div className="flex items-center justify-between">
            <div>
              <p className="text-blue-300 text-sm font-medium">Low Risk Cases</p>
              <p className="text-2xl font-bold text-white">{spamReviews.filter(r => r.priority === 'low').length}</p>
            </div>
            <Package className="h-5 w-5 text-blue-400" />
          </div>
        </div>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredAlerts.map((review) => (
          <div 
            key={review.id} 
            className={`bg-gray-800 rounded-lg p-6 border border-gray-700 cursor-pointer hover:bg-gray-700 transition-colors ${
              selectedAlert?.id === review.id ? 'ring-2 ring-blue-500' : ''
            }`}
            onClick={() => setSelectedAlert(review)}
          >
            <div className="flex items-start justify-between mb-4">
              <div>
                <h3 className="text-lg font-bold text-white">{review.id}</h3>
                <span className={`inline-block px-3 py-1 rounded-full text-xs font-semibold ${getPriorityColor(review.priority)} mt-1`}>
                  {review.priority.charAt(0).toUpperCase() + review.priority.slice(1)}
                </span>
              </div>
            </div>

            <h4 className="text-xl font-semibold text-white mb-2">{review.title}</h4>
            <p className="text-gray-400 text-sm mb-4">{review.description}</p>

            <div className="space-y-2 text-sm">
              <div className="flex justify-between">
                <span className="text-gray-400">Customer ID:</span>
                <span className="text-white font-mono">{review.customerId}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-400">Amount:</span>
                <span className="text-white font-semibold">{review.amount}</span>
              </div>
              <div className="flex justify-between">
                <span className="text-gray-400">Category:</span>
                <span className="text-white">{review.category}</span>
              </div>
            </div>

            <div className="flex items-center justify-between mt-4 pt-4 border-t border-gray-600">
              <div className="flex items-center space-x-2">
                <Clock className="h-4 w-4 text-gray-400" />
                <span className="text-gray-400 text-sm">{review.timeframe}</span>
              </div>
              <div className="text-right">
                <div className="text-sm text-gray-400">Risk Score:</div>
                <div className={`text-lg font-bold ${getRiskScoreColor(review.riskScore)}`}>
                  {review.riskScore}%
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>

      <InvestigationPanel selectedAlert={selectedAlert} handleAction={handleAction} />
    </div>
  );
};

export default ReviewSpamPage;
